'use strict';

;( function ( document, window, index )
{
	var inputs = document.querySelectorAll( '.inputfile' );
	Array.prototype.forEach.call( inputs, function( input )
	{
		var label	 = input.nextElementSibling,
			labelVal = label.innerHTML;

		input.addEventListener( 'change', function( e )
		{
			var fileName = '';
			if( this.files && this.files.length > 1 )
				fileName = ( this.getAttribute( 'data-multiple-caption' ) || '' ).replace( '{count}', this.files.length );
			else
				fileName = e.target.value.split( '\\' ).pop();

			if( fileName )
				label.querySelector( 'span' ).innerHTML = fileName;
			else
				label.innerHTML = labelVal;
		});

		// Firefox bug fix
		input.addEventListener( 'focus', function(){ input.classList.add( 'has-focus' ); });
		input.addEventListener( 'blur', function(){ input.classList.remove( 'has-focus' ); });
	});
}( document, window, 0 ));



// 10. HOVERTABS
;
(function($) {
	$.fn.tab = function(options) {
		var opts = $.extend({}, $.fn.tab.defaults, options);
		return this.each(function() {
			var obj = $(this);

			$(obj).find('.tabHeader li').on(opts.trigger_event_type, function() {
				$(obj).find('.tabHeader li').removeClass('active');
				$(this).addClass('active');
				
				/*$(obj).find('.tabContent div').hide();
				$(obj).find('.tabContent div').eq($(this).index()).show();*/
				
				$(obj).find('.tabContent div').removeClass('show');
				$(obj).find('.tabContent div').removeClass('active');
				var abc = $(obj).find('.tabContent div').eq($(this).index());
				
				setTimeout(function(){abc.addClass('show')},400);
			})
		});
	}
	$.fn.tab.defaults = {
		trigger_event_type: 'click', //mouseover | click click
	};

})(jQuery);


